import React from "react"
import { Link } from "react-router-dom"

const Nav =()=>{
    return(
        <nav className="w-full h-[100px] bg-gray-800 flex flex-row-reverse ">
            <Link className="text-white text-2xl flex items-center justify-center"
               to={`/Contacto`}
               >
                <span className="text-center">Acerca de mi</span> 
            </Link>
        </nav>
        
    )

}

export default Nav
